import Vue from 'vue';
import Vuetify from 'vuetify';
import 'vuetify/dist/vuetify.min.css';

Vue.use(Vuetify);

const opts = {}; // Vous pouvez ajouter des options ici si nécessaire

export default new Vuetify(opts);
